id="fw_c" class="clearfix tf_single_page"><div class="vc_row wpb_row vc_row-fluid vc_custom_1570194192157 full-width-section " style="margin-left: -467.5px; padding-left: 467.5px; padding-right: 467.5px; visibility: visible; width: 100%; margin-right: 0px; padding-top: 100px;"><div class="vc_span12 wpb_column vc_column_container "><div class="vc_column-inner "><div class="wpb_wrapper"><div class="wpb_text_column wpb_content_element   ct_60p81u5yzncn79mbzgtn"><div class="wpb_wrapper"><h1 style="text-align: center; padding-top: 80px;">BlockFi Institutional Services</h1></div></div><style type="text/css">#l_h4akf53pvs3awmy7pp4i{width:120px}#l_h4akf53pvs3awmy7pp4i.sc_line,#l_h4akf53pvs3awmy7pp4i .sc_line{border-top:3px solid #002ea7}#l_h4akf53pvs3awmy7pp4i.sc_line,#l_h4akf53pvs3awmy7pp4i .sc_line{margin-left:auto!important;margin-right:auto!important}#l_h4akf53pvs3awmy7pp4i{margin:0 0 30px 0;padding:0}</style><div class="clearfix"></div><div id="l_h4akf53pvs3awmy7pp4i" class="sc_line rd_line_bold"></div><div class="vc_row wpb_row vc_inner vc_row-fluid vc_custom_1570195067021"><div class="wpb_column vc_column_container vc_span2"><div class="vc_column-inner  "></div></div><div class="wpb_column vc_column_container vc_span8"><div class="vc_column-inner  "><div class="wpb_wrapper"><div class="wpb_text_column wpb_content_element   ct_hhop6tyy4v5kgvgamwdi"><div class="wpb_wrapper"><p style="text-align: center;">The BlockFi Institutional Services team provides customizable lending of cryptocurrencies, stablecoins, and US dollars to institutions.</p><p style="text-align: center;">Our business is powered by BlockFi’s retail crypto balances – one of the largest and fastest growing digital asset pools on the planet.</p></div></div><style type="text/css">#b_fmya9crej3iejduvfrg8 a{color:#002ea7;background:;border-style:solid;border-color:#002ea7;margin-top:30pxpx;margin-bottom:0;margin-left:0;margin-right:0;font-weight:500;border-radius:0}#b_fmya9crej3iejduvfrg8 a:hover{color:;background:;border-color:}</style><div class="ta_center tf_btn_pos" id="b_fmya9crej3iejduvfrg8"><a class="rd_stroke_bt medium_rd_bt border_1px  " href="https://blockfi.com/institutional-contact/#connect" target="">CONNECT WITH US</a></div></div></div></div><div class="wpb_column vc_column_container vc_span2"><div class="vc_column-inner  "></div></div></div></div></div></div></div><div class="vc_row wpb_row vc_row-fluid vc_custom_1570195281471 full-width-section " style="margin-left: -467.5px; padding-left: 467.5px; padding-right: 467.5px; visibility: visible; width: 100%; margin-right: 0px;"><div class="vc_span12 wpb_column vc_column_container "><div class="vc_column-inner "><div class="wpb_wrapper"><div class="wpb_text_column wpb_content_element  vc_custom_1570201261037  ct_9ym1dz82vil9048hyj57"><div class="wpb_wrapper"><h2 style="text-align: center;"><span style="color: #ffffff;">Features</span></h2></div></div><div class="wpb_text_column wpb_content_element   ct_s5su4k11hn0a6q64esgo"><div class="wpb_wrapper"><table class="tron-table" width="100%"><tbody><tr><td><h2>Client First</h2></td><td><img data-savepage-src="https://blockfi.com/wp-content/uploads/2019/10/191015_Institutional_icons_1.png" src="data:image/png;base64," data-lazy-src="https://blockfi.com/wp-content/uploads/2019/10/191015_Institutional_icons_1.png" alt="" class="lazyloaded" data-was-processed="true"><noscript><img src="https://blockfi.com/wp-content/uploads/2019/10/191015_Institutional_icons_1.png" alt="" /></noscript></td><td><div class="height-control"><p>We are dedicated to a client-centric approach across our product offering and servicing.</p><p>Our products are tailored towards each institution’s strategy, and we are positioned to evolve alongside our clients and exceed their future expectations.</p></div><p class="height-toggle" style="display: none;"><a><strong>MORE</strong></a></p></td></tr><tr><td><h2>Strategic Partner</h2></td><td><img data-savepage-src="https://blockfi.com/wp-content/uploads/2019/10/191015_Institutional_Icons_arrow.png" src="data:image/png;base64," data-lazy-src="https://blockfi.com/wp-content/uploads/2019/10/191015_Institutional_Icons_arrow.png" alt="" class="lazyloaded" data-was-processed="true"><noscript><img src="https://blockfi.com/wp-content/uploads/2019/10/191015_Institutional_Icons_arrow.png" alt="" /></noscript></td><td><div class="height-control"><p>BlockFi acts as a strategic resource for clients across lending, hedging, structuring, and other institutional products.</p><p>Clients seek our insight into the institutional cryptocurrency landscape, and we serve as a partner to entry into the digital asset market.</p></div></td></tr><tr><td><h2>Pioneering Approach</h2></td><td><img data-savepage-src="https://blockfi.com/wp-content/uploads/2019/10/191015_Institutional_Icons_Infinity.png" src="data:image/png;base64," data-lazy-src="https://blockfi.com/wp-content/uploads/2019/10/191015_Institutional_Icons_Infinity.png" alt="" class="lazyloaded" data-was-processed="true"><noscript><img src="https://blockfi.com/wp-content/uploads/2019/10/191015_Institutional_Icons_Infinity.png" alt="" /></noscript></td><td><div class="height-control"><p>BlockFi has created a proprietary institutional infrastructure that facilitates rapid onboarding, trade execution, and enterprise-grade reporting.</p><p>Our approach is appreciated by our clients and we have been recognized as an industry disrupting innovator by the Futures Industry Association.</p></div></td></tr><tr><td><h2>Industry Leaders</h2></td><td><img data-savepage-src="https://blockfi.com/wp-content/uploads/2019/10/191015_Institutional_Icons_Leader.png" src="data:image/png;base64," data-lazy-src="https://blockfi.com/wp-content/uploads/2019/10/191015_Institutional_Icons_Leader.png" alt="" class="lazyloaded" data-was-processed="true"><noscript><img src="https://blockfi.com/wp-content/uploads/2019/10/191015_Institutional_Icons_Leader.png" alt="" /></noscript></td><td><div class="height-control"><p class="p">The BlockFi Institutional Services team has over 50 years of combined experience in global capital markets and investment banking.</p><p class="p">Our leadership team has a proven track-record in delivering financial innovation driven by a reliable ecosystem and legal &amp; regulatory best practices.</p></div></td></tr></tbody></table></div></div><div class="wpb_text_column wpb_content_element  vc_custom_1571332268967  ct_gce2j08w24tn715bzwhl"><div class="wpb_wrapper"><h2 style="text-align: center;"><span style="color: #ffffff;">Leadership</span></h2></div></div><div class="wpb_text_column wpb_content_element   ct_tlqiwpopil2ooge87qrr"><div class="wpb_wrapper"><ul id="accordion"><li class="active"><div class="team-member"><img data-savepage-src="https://blockfi.com/wp-content/uploads/2019/10/191017Rene.png" src="data:image/png;base64," data-lazy-src="https://blockfi.com/wp-content/uploads/2019/10/191017Rene.png" class="lazyloaded" data-was-processed="true"><noscript><img src="https://blockfi.com/wp-content/uploads/2019/10/191017Rene.png" /></noscript><strong>RENE VAN KESTEREN</strong><i>CRO, Head of Institutional Services</i></div><p class="p">Since 2004, Rene was at Bank of America Merrill Lynch, where he most recently was a Managing Director of ML Professional Clearing / Prime Brokerage. During his time there, he built the equity structured lending platform, including risk and regulatory compliance frameworks. Prior to BAML, Rene worked as an equity derivatives trader in Caxton’s Strategic Quantitative Investment Division. He has an MBA from the Rotterdam School of Management and Columbia Business School.</p></li><li><div class="team-member"><img src="data:image/gif;base64,R0lGODdhAQABAPAAAP///wAAACwAAAAAAQABAEACAkQBADs=" data-lazy-src="https://blockfi.com/wp-content/uploads/2019/10/191017Jessica.png"><noscript><img src="https://blockfi.com/wp-content/uploads/2019/10/191017Jessica.png" /></noscript><strong>JESSICA RAYBECK</strong><i>Head of Institutional Client Relations</i></div><p class="p">Prior to BlockFi, Jessica was a Vice President at Nomura Securities, leading an Institutional Client Facilitation team specializing in customization, optimization and innovation in Capital Markets. Upon graduation from the University at Buffalo in 2007, she started her career at Citigroup working through various Institutional Client regulatory updates. In 2014, The Women’s Bond Club of NY publicly recognized Jessica as being an emerging leader in the financial industry.</p></li><li><div class="team-member"><img src="data:image/gif;base64,R0lGODdhAQABAPAAAP///wAAACwAAAAAAQABAEACAkQBADs=" data-lazy-src="https://blockfi.com/wp-content/uploads/2019/10/191017Yev.png"><noscript><img src="https://blockfi.com/wp-content/uploads/2019/10/191017Yev.png" /></noscript><strong>YEV FELDMAN</strong><i>Head of Institutional Risk &amp; Trading</i></div><p class="p">Yev joined BlockFi from Bank of America Merrill Lynch, where he was a Vice President in the Equities division. He brings experience in building institutional lending platforms and risk management systems, as well as technical expertise in developing structured financing solutions for funds, trading firms, banks, and private clients. Prior to BAML, Yev worked at UBS after graduating from Cornell University in 2010. He is passionate about emerging disruptive technologies such as deep learning and cryptocurrency.</p></li></ul></div></div><div class="wpb_accordion wpb_content_element  testimonials_accordion team_acc rd_acc_1 not-column-inherit" data-collapsible="yes" data-active-tab="1" style="margin-top:0; margin-bottom:0; "><div class="wpb_wrapper wpb_accordion_wrapper ui-accordion ui-widget ui-helper-reset" role="tablist"><style type="text/css">.rd_acc_1 #rd_qjwdlnpo09dsl62vjwhk .wpb_accordion_header{color:#fff;background:#000;border:1px solid #fff}.rd_acc_1 #rd_qjwdlnpo09dsl62vjwhk .wpb_accordion_header a{color:#fff}.rd_acc_1 #rd_qjwdlnpo09dsl62vjwhk .ui-accordion-header-icon{